member.example:
This sample shows how to call GetTargetTypeAsync and parse the result.

TokenCredential credential = new DefaultAzureCredential();
TargetTypesClient client = new TargetTypesClient(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), credential);

Response response = await client.GetTargetTypeAsync("<location>", "<targetTypeName>", null);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("properties").ToString());

